import React from 'react';

const Portfolioitem = props => {
	const style = {
		backgroundImage: 'url(' + props.backgroundImageURL + ')',
		backgroundSize: '100% 100%'
	};

	return (
		<div className="portfolio-item" style={style}>
			{props.name}
		</div>
	);
};

export default Portfolioitem;
